import "./style.css";
import { BoldOriginals } from "./components/BoldOriginals/BoldOriginals";
import { Footer } from "./components/Footer/Footer";
import { SignUpBanner } from "./components/SignUpBanner/SignUp";
// import { NavBar } from "./components/NavBar/NavBar";
const StarzWebApp = () => {
  return (
    <>
      {/* <NavBar /> */}
      {/* <h1>StarzWebApp</h1> */}
      <SignUpBanner />
      <BoldOriginals />
      <Footer />
    </>
  );
};
export default StarzWebApp;
